import React, { useState } from "react";
import { GoogleOAuthProvider } from "@react-oauth/google";
import WelcomePage from "./components/WelcomePage";
import SignupForm from "./components/SignUpForm";
import HomePage from "./components/HomePage";
import InputForm from "./components/InputForm";
import Sidebar from "./components/Sidebar";
import TopNavbar from "./components/TopNavbar";

const clientId = "881037752146-jhiu2q74gfkkj7phe2034p53m3nd5k6c.apps.googleusercontent.com";

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isProfileComplete, setIsProfileComplete] = useState(false);
  const [user, setUser] = useState(null);
  const [currentPage, setCurrentPage] = useState("home");
  const [errorMessage, setErrorMessage] = useState("");
  const [studyGuide, setStudyGuide] = useState("");
  const [history, setHistory] = useState([]); 
  const [selectedStudyGuide, setSelectedStudyGuide] = useState(null);
// Store previous study guides

  const handleLoginSuccess = (user) => {
    setIsAuthenticated(true);
    setIsProfileComplete(true);
    setUser(user);
    setCurrentPage("home");
    setErrorMessage("");
  };

  const handleSignupSuccess = (user) => {
    setIsAuthenticated(true);
    setIsProfileComplete(false);
    setUser(user);
    setCurrentPage("signup");
    setErrorMessage("");
  };

  const handleProfileSubmit = async (profileData) => {
    const newUser = { ...user, ...profileData };

    try {
      const response = await fetch("http://localhost:8000/api/users", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newUser),
      });

      if (response.ok) {
        setIsProfileComplete(true);
        setCurrentPage("home");
      } else {
        setErrorMessage("Failed to save profile. Please try again.");
      }
    } catch (error) {
      console.error("Error saving profile:", error);
      setErrorMessage("Error saving profile. Please try again.");
    }
  };

  const handleLogout = () => {
    setIsAuthenticated(false);
    setIsProfileComplete(false);
    setUser(null);
    setCurrentPage("home");
    setErrorMessage("");
  };

  // Store generated study guides
  const handleStudyGuideGenerated = (generatedText) => {
    const newEntry = { topic: generatedText.slice(0, 20) + "...", studyGuide: generatedText };
    setHistory((prevHistory) => [...prevHistory, newEntry]);
    setStudyGuide(generatedText);
  };

  // Load a past study guide
  const handleLoadStudyGuide = (selectedGuide) => {
    setStudyGuide(selectedGuide.content);
    setCurrentPage("studyGuide");
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setStudyGuide("");
    setDisplayedText("");
    setIsLoading(true);

    try {
      const response = await fetch("http://localhost:8000/generate-guide", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ user_prompt: topic }),
      });

      if (response.ok) {
        const data = await response.json();
        setStudyGuide(data.study_guide);

        // ✅ Pass the topic & generated text to App.js for saving
        onStudyGuideGenerated(data.study_guide, topic);
      } else {
        setError("Failed to generate study guide. Please try again.");
      }
    } catch (err) {
      console.error("Fetch error:", err);
      setError("Error communicating with the backend.");
    } finally {
      setIsLoading(false);
    }
  };


  const renderPage = () => {
    if (!isAuthenticated) {
      return (
        <WelcomePage
          onLoginSuccess={handleLoginSuccess}
          onSignupSuccess={handleSignupSuccess}
          errorMessage={errorMessage}
          setErrorMessage={setErrorMessage}
        />
      );
    }

    if (!isProfileComplete) {
      return <SignupForm onSubmit={handleProfileSubmit} />;
    }

    switch (currentPage) {
      case "studyGuide":
      return (
        <InputForm
          onStudyGuideGenerated={handleStudyGuideGenerated}
          studyGuide={studyGuide}
          user={user}
          selectedStudyGuide={selectedStudyGuide}
        />
      );
      case "home":
      return (
        <HomePage
          onNavigate={(page) => {
            if (page === "studyGuide") {
              setSelectedStudyGuide(null); // ✅ Reset selected study guide
              setStudyGuide(""); // ✅ Clear previous study guide
            }
            setCurrentPage(page);
          }}
          setSelectedStudyGuide={setSelectedStudyGuide} // ✅ Pass this prop
        />
      );
    default:
      return <HomePage onNavigate={setCurrentPage} />;
  }
  };

  return (
    <GoogleOAuthProvider clientId={clientId}>
      <div className="app">

        {isAuthenticated && isProfileComplete && (
          <Sidebar
            onNavigate={setCurrentPage}
            onSelectHistory={setSelectedStudyGuide}  // ✅ Load clicked study guide
            onLogout={handleLogout}
            user={user}
            currentPage={currentPage}
          />
        )}
        <div className={`main-content ${!isAuthenticated ? "centered" : ""}`}>
          {renderPage()}
        </div>
      </div>
    </GoogleOAuthProvider>
  );
}

export default App;
